descricao:
Aprovado com a inclusão dos seguintes convidados:
- Nelson Hubner - ex-Ministro do MME, ex-Presidente da ANEEL, atual conselheiro da CEMIG;
- Representante do Coletivo Nacional dos Eletricitários;
- João Bosco Almeida - ex-Presidente da Chesf;
- Gustavo Teixeira - DIEESE;
- Dorival Goncalves Junior -  Doutor em engenharia elétrica pela USP e professor da UFMT;
- Gilberto Berchiovici - Jurista da USP;
- Luiz Alberto Rocha - Professor Doutor em Direito Publico pela UFPA;
- Joel Kruger - Presidente do CONFEA.
Subscreveram o requerimento os Deputados:
Alessandro Molon, Danilo Cabral e Patrus Ananias
